import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Container, Card, Form, Button, Alert } from 'react-bootstrap';
import API from '../services/api';
import Logo from './Logo';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const { email, password } = formData;

  const onChange = e => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const onSubmit = async e => {
    e.preventDefault();
    setLoading(true);
    try {
      const res = await API.post('/api/auth/login', { email, password });
      localStorage.setItem('token', res.data.token);
      navigate('/dashboard');
    } catch (err) {
      setError(err.response?.data?.message || 'Login failed');
    }
    setLoading(false);
  };

  return (
    <div className="login-container fade-in">
      <Container className="d-flex justify-content-center align-items-center">
        <Card className="login-card">
          <div className="login-header">
            <Logo size="lg" />
            <p className="mt-3 mb-0">Customer Management Portal</p>
          </div>
          
          <Card.Body className="login-body">
            {error && (
              <Alert variant="danger" className="mb-4">
                <i className="fas fa-exclamation-circle me-2"></i>
                {error}
              </Alert>
            )}
            
            <Form onSubmit={onSubmit}>
              <Form.Group className="mb-3">
                <Form.Label>Email Address</Form.Label>
                <Form.Control
                  type="email"
                  name="email"
                  value={email}
                  onChange={onChange}
                  required
                  className="form-control-cstech"
                  placeholder="Enter your email"
                />
              </Form.Group>
              
              <Form.Group className="mb-4">
                <Form.Label>Password</Form.Label>
                <Form.Control
                  type="password"
                  name="password"
                  value={password}
                  onChange={onChange}
                  required
                  className="form-control-cstech"
                  placeholder="Enter your password"
                />
              </Form.Group>
              
              <Button
                type="submit"
                disabled={loading}
                className="btn-cstech w-100 py-2"
              >
                {loading ? (
                  <>
                    <span className="loading-spinner me-2"></span>
                    Signing in...
                  </>
                ) : (
                  'Sign In'
                )}
              </Button>
            </Form>
            
            <div className="mt-4 p-3 bg-light rounded">
              <h6 className="text-center text-cstech mb-2">Demo Credentials:</h6>
              <div className="text-center">
                <small className="text-muted">Email: admin@example.com</small>
                <br />
                <small className="text-muted">Password: admin123</small>
              </div>
            </div>
            
            <div className="text-center mt-4">
              <small className="text-muted">Â© 2024 CSTech Infosolutions Pvt. Ltd.</small>
            </div>
          </Card.Body>
        </Card>
      </Container>
    </div>
  );
};

export default Login;
